import React, { Component } from 'react';

import './Shop.css'

class Shop extends Component {
    render() {
        return(
            <div>
                <a className="Shop" href="#">Shop</a>
                <i className="fas fa-angle-dow">Hello world</i>

            </div>
        )
    }
}

export default Shop;
